func Test_volumeLetterCheck(t *testing.T) {
	type args struct {
		volumeLetter string
	}
	tests := []struct {
		name    string
		args    args
		wantErr bool
	}{
		{
			name:    "test1",
			args:    args{volumeLetter: "C"},
			wantErr: false,
		},
		{
			name:    "test2",
			args:    args{volumeLetter: "Cc"},
			wantErr: true,
		},
		{
			name:    "test3",
			args:    args{volumeLetter: "1"},
			wantErr: true,
		},
		{
			name:    "test4",
			args:    args{volumeLetter: ""},
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if err := volumeLetterCheck(tt.args.volumeLetter); (err != nil) != tt.wantErr {
				t.Errorf("volumeLetterCheck() error = %v, wantErr %v", err, tt.wantErr)
			}
		})
	}
}
